import React from "react";
import CommonInput from "./components/CommonInput";
import ImgInput from "./components/ImgInput";

import pwImg from "./img/SignUp/pencil.png";
import pwCheckImg from "./img/SignUp/check.png";
import BirthYearInput from "./components/BirthYearInput";

export default function SignUp() {
  //css 선언부

  return (
    <div className="h-screen bg-neutral-100/60 font-naver">
      <div className="h-24"></div>
      <form className="flex flex-col items-center">
        <CommonInput
          title="아이디"
          type="text"
          id="id"
          backPH="@study-hotel.com"
        />
        <ImgInput 
          title="비밀번호" 
          type="password" 
          id="password" 
          src={pwImg} 
        />
        <ImgInput
          title="비밀번호 재확인"
          type="password"
          id="passwordCheck"
          src={pwCheckImg}
        />
        <div className="h-3"></div>
        <BirthYearInput/>
        <div>생년월일</div>
        <div>성별</div>
        <div>주소</div>
        <div>휴대전화</div>
        <div>가입하기</div>
        <div>가입하기</div>
        <div>가입하기</div>
      </form>
    </div>
  );
}
